import React from 'react';

const Weather = () => {
    return (
        <div>
           <p>Location: Il, Rehovot</p>
            <p>Temp: 20</p>
            <p>Pressure: 700</p>
            <p>Sunset: 17:00</p>
        </div>
    );
};

export default Weather;
